def yield_from(generator, exc, assignment):
    let(iterable)
    iterable = iter(generator)
    while True:
        try:
            yield next(iterable)
        except StopIteration as exc:
            extend(assignment)
            break

def return_from_generator(return_value):
    let(exc)
    exc = StopIteration()
    exc.value = return_value
    raise exc
